import React from 'react';
import Form from '../Testimonials/form.js';
import ReviewList from './ReviewList.js';
import '../Testimonials/index.css';
 




const Testimonial = () => (
  <div>
    <AuthUserContext.Consumer>
      {authUser =>
        authUser ? <NavigationAuth /> : <NavigationNonAuth />
      }
    </AuthUserContext.Consumer>

  </div>
);


const Testimonials =() => (
 
